import characters from '../db/Character/Character';

function list(props) {
  return <li>I am a { props.brand }</li>;
}

function Character() {

  return (
    <>
      <h1>Who lives in my garage?</h1>
      <ul>
        <characters />
        {characters.map((car) => <list key={car.id} brand={car.brand} />)}
      </ul>
    </>
  );
}
export default Character;
